The entire thing seems to be protobuf after doing the initial unwrapping with urldecode and base64 decode. <pre><code>grp1</code></pre> was a timestamp, but I'm not yet sure what the 32-bit floats are used for. Should be easier to go forward now that the format is known, though.
I found this tool helpful decoding the data: https://github.com/omarroth/protodec
